import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className = 'app-wrapper'>
      <header className=''>
        <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/5/59/Firefox_Project_Logo%2C_2019.svg/1024px-Firefox_Project_Logo%2C_2019.svg.png'></img>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>Main contet </div>
      </nav>
    </div>
  );
}

export default App;
